import { Config } from './config';
import { version } from './version';

function track() {
  if (Config.trackable) {
    var host = 'https://kcart.alipay.com/web/bi.do';
    var img = new Image();
    var metadata = Object.assign(Object.assign({}, Config.trackInfo), {
      version: version,
      pg: document.URL,
      r: new Date().getTime(),
      x6: true,
      page_type: 'syslog'
    });
    var data = encodeURIComponent(JSON.stringify([metadata]));
    img.src = "".concat(host, "?BIProfile=merge&d=").concat(data);
  }
}

if (process.env.NODE_ENV !== 'development' && Config.trackable) {
  setTimeout(track, 3000);
}
